import {Component} from '@angular/core';
import {MatIconModule} from "@angular/material/icon";
import {MatButtonModule} from "@angular/material/button";

@Component({
  selector: 'app-header',
  templateUrl: './app-header.component.html',
  styleUrls: ['./app-header.component.css'],
  imports: [MatIconModule, MatButtonModule],
  standalone: true
})
export class AppHeaderComponent {

}
<header class="d-flex justify-content-between container align-items-center ">

  <div class="d-flex align-items-center">
    Home food
    <button mat-button>
      <mat-icon class="mx-2" aria-hidden="false" aria-label="Example home icon" fontIcon="home"/>
    </button>
  </div>
  <mat-icon aria-hidden="false" aria-label="Example home icon" fontIcon="shopping_cart"/>

</header>
